import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FaMapMarkerAlt, FaMountain, FaWater, FaLeaf } from 'react-icons/fa';

const Origin: React.FC = () => {
  const { ref, inView } = useInView({
    triggerOnce: true,
    threshold: 0.3
  });

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { y: 30, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: { duration: 0.8, ease: "easeOut" as const }
    }
  };

  return (
    <section className="origin-section" ref={ref}>
      <motion.div 
        className="container"
        variants={containerVariants}
        initial="hidden"
        animate={inView ? "visible" : "hidden"}
      >
        <motion.h2 className="section-title" variants={itemVariants}>
          源自天然产地
        </motion.h2>
        
        <motion.div className="origin-content" variants={itemVariants}>
          <div className="map-container">
            <div className="map-placeholder">
              <FaMapMarkerAlt className="map-marker" size={48} />
              <div className="location-info">
                <h3>陕西 • 眉县</h3>
                <p>眉县位于太白山脚下，昼夜温差大，光照充足，猕猴桃自然甜度高，口感酸甜适中，被誉为“中国猕猴桃之乡”</p>
              </div>
            </div>
          </div>
          
          <div className="environment-cards">
            <motion.div 
              className="env-card"
              variants={itemVariants}
              whileHover={{ scale: 1.05 }}
            >
              <FaLeaf className="env-icon" size={40} />
              <h4>正宗徐香猕猴桃</h4>
              <p>果形端正、果肉翠绿、汁水丰富，口感酸甜平衡，富含维C与膳食纤维，深受消费者喜爱</p>
            </motion.div>

            <motion.div 
              className="env-card"
              variants={itemVariants}
              whileHover={{ scale: 1.05 }}
            >
              <FaMountain className="env-icon" size={40} />
              <h4>优质土壤</h4>
              <p>富含有机质的黄土，为猕猴桃提供充足养分</p>
            </motion.div>

            <motion.div 
              className="env-card"
              variants={itemVariants}
              whileHover={{ scale: 1.05 }}
            >
              <FaWater className="env-icon" size={40} />
              <h4>纯净水源</h4>
              <p>农夫山泉水源地，太白山山泉灌溉，确保每一颗果实的纯净品质</p>
            </motion.div>
            
            <motion.div 
              className="env-card"
              variants={itemVariants}
              whileHover={{ scale: 1.05 }}
            >
              <FaLeaf className="env-icon" size={40} />
              <h4>生态环境</h4>
              <p>远离工业污染，坚持有机种植理念</p>
            </motion.div>
          </div>
        </motion.div>
        
        <motion.div className="origin-story" variants={itemVariants}>
          <p className="story-text">
            奶奶在这片土地上耕耘了30多年，用传统的种植方式，
            不使用农药化肥，只为让大家品尝到最纯正的猕猴桃味道。
          </p>
        </motion.div>
      </motion.div>
    </section>
  );
};

export default Origin;
